import "./district/DistrictData";
import PROVINCE_LIST from "./district/DistrictData";
import {Button} from "react-bootstrap";
import {useState} from "react";

function District() {
    const [cur, setCur] = useState('무관');

    return (
        <div>
            <p>지역</p>
            <Button
                key="지원종류무관"
                className={(cur === '무관' ? "activeButton" : "inactiveButton")}
                onClick={() => setCur('무관')}
            >
                무관
            </Button>
            {PROVINCE_LIST.map(province =>
                <Button
                    key={province}
                    className={(cur === province ? "activeButton" : "inactiveButton")}
                    onClick={() => setCur(province)}
                >
                    {province}
                </Button>
            )}
        </div>
    )
}

export default District;
